import React from 'react'

export class Box extends React.Component {

    constructor(props) {
        super(props)

    }

    render() {
        return (
            <div>
                <div className='box'>
                    <h3>Person</h3>
                    <p>Name : {this.props.name}</p>
                    <p>Age : {this.props.age} </p>
                    <p>{this.props.children}</p>
                </div>
            </div>
        )
    }

}

export function Box2(props) {
